import React from 'react';
import {Button} from 'react-bootstrap';

//hook-Logic
import useSwitch from './useSwitch';
const Switch = ()=>{
    const [ActiveButton,ButtonRef] = useSwitch();

    return (
        <Button ref = {ButtonRef} variant = 'dark'>Search</Button>
    )
}
export default Switch;
